    state = {
        count: 0,
        countries: [],
        visCountries: [],
        length:0
    }
    
    componentDidMount (){
        const path_name = ('https://restcountries.eu/rest/v2/name/');
        axios.get(path_name).then(response => {
            this.setState({
                countries: response.data,
                visCountries: response.data,
                length:response.data.length
            });
        });
    }

